function Footer() {
    return (
    <div className="flex-container">
        <footer>
            <a href = "#"> About Us </a>
            <a href = "#"> Contact Us </a>
            <div class="circle"> 
            <div class="circlelinkedin"><li> <a href = "#"> < i class="fa fa-linkedin"></i> </a></li> </div>
            <div class="circleinsta"></div><li> <a href = "#"> < i class="fa fa-instagram"></i> </a></li>
            </div>
        </footer>
    </div>
    )
}
export default Footer;
